While preparing this model, I first used the original model in the StarFox Assault game released in 2005 when this model was released. I added some modern light effects on that model, I doubled the graphics quality, but there may still be quality errors in some parts.

Krystal has always been a very special character for me. I met you when I was staying with my grandfather, especially at a young age when my father had heart disease and I was diabetic. The moment I saw him on the cover of the magazine called MK, I bought that magazine just to find out who he was. Thanks to Krystal alone, I learned how creative the gaming industry can be and started researching the industry … These models were made with the hope that they could inspire a StarFox Assault Remake project that could one day be done, and the models are originally owned by Nintendo.", 'faceCount': 2020, 'createdAt': '2020-11-01T16:18:12.635525', 'vertexCount': 1054, 'isAgeRestricted': False, 'archives': {'glb': {'textureCount': 1, 'size': 687244, 'type': 'glb', 'textureMaxResolution': 512, 'faceCount': 2020, 'vertexCount': 6056}, 'gltf': {'textureCount': 1, 'size': 327309, 'type': 'gltf', 'textureMaxResolution': 512, 'faceCount': 2020, 'vertexCount': 6056}, 'source': {'textureCount': None, 'size': 1208243, 'type': 'source', 'textureMaxResolution': None, 'faceCount': None, 'vertexCount': None}, 'usdz': {'textureCount': None, 'size': 456598, 'type': 'usdz', 'textureMaxResolution': None, 'faceCount': None, 'vertexCount': None}}, 'license': 'by'}

